import i18next from "i18next";

import enSidemenu from "./en/sidemenu.json";
import tuSidemenu from "./tu/sidemenu.json";

export default i18next.init({
  interpolation: { escapeValue: false },
  lng: "th",
  resources: {
    en: {
      translation: {
        sidemenu: enSidemenu,
      },
    },
    th: {
      translation: {
        sidemenu: tuSidemenu,
      },
    },
  },
});
